text:
"- прийти до мене в твіттер;
- нагородити хуйні; 
- не припиняти городити хуйню;
- проситися, щоб я від'їбалася. 
[городити хуйню про грамотність жахливо неграмотними і українською, і російською мовами: вишенька на тортику цієї феєрії]"

"Я: Чув що в авішках з торентів можуть бути вірусняки через stack ovefflow
@enrica_fermi: Спектр? І чуваки в тебе на лептопі майнитимуть біткойн
Я: Це в кращому випадку
@enrica_fermi: Майнитимуть твої кредитки"
